import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { Modal, Button } from 'react-bootstrap';

const NavbarComponent = () => {
  const [showModal, setShowModal] = useState(false);
  const navigate = useNavigate();

  const handleModalOpen = () => {
    setShowModal(true);
  };

  const handleModalClose = () => {
    setShowModal(false);
  };

  const handleLogin = () => {
    // Logika logowania
    handleModalClose();
    navigate('/');
  };

  return (
    <nav className='navbar navbar-expand-lg navbar-light bg-light'>
      <div className='container'>
        <Link className='navbar-brand' to='/'>
          Logo
        </Link>

        <button className='navbar-toggler' type='button' onClick={handleModalOpen}>
          <span className='navbar-toggler-icon'></span>
        </button>

        <div className={`collapse navbar-collapse ${showModal ? 'show' : ''}`}>
          <ul className='navbar-nav ms-auto'>
            <li className='nav-item'>
              <Link className='nav-link active' to='/'>
                Active
              </Link>
            </li>
            <li className='nav-item dropdown'>
              <div className='nav-link dropdown-toggle' onClick={handleModalOpen}>
                Zaloguj
              </div>
              <div className={`dropdown-menu ${showModal ? 'show' : ''}`}>
                <Link className='dropdown-item' to='/login'>
                  Action
                </Link>
                <Link className='dropdown-item' to='/register'>
                  Action two
                </Link>
              </div>
            </li>
          </ul>
        </div>
      </div>

      {showModal && (
        <Modal show={showModal} onHide={handleModalClose}>
          <Modal.Header closeButton>
            <Modal.Title>Login</Modal.Title>
          </Modal.Header>
          <Modal.Body>
            <div className='form-floating mb-3'>
              <input type='email' className='form-control' id='floatingInput' placeholder='name@example.com' />
              <label htmlFor='floatingInput'>Email address</label>
            </div>
            <div className='form-floating'>
              <input type='password' className='form-control' id='floatingPassword' placeholder='Password' />
              <label htmlFor='floatingPassword'>Password</label>
            </div>
          </Modal.Body>
          <Modal.Footer>
            <Button variant='secondary' onClick={handleModalClose}>
              Cancel
            </Button>
            <Button variant='primary' onClick={handleLogin}>
              Login
            </Button>
          </Modal.Footer>
        </Modal>
      )}
    </nav>
  );
};

export default NavbarComponent;
